package main

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"io/ioutil"
	"strings"
)

func parseEmbeddedData(data string) string {
	data = strings.TrimSpace(data)
	gzipped, err := base64.StdEncoding.DecodeString(data)
	if err != nil {
		panic(err)
	}
	reader := bytes.NewReader(gzipped)
	gzip, err := gzip.NewReader(reader)
	if err != nil {
		panic(err)
	}
	result, err := ioutil.ReadAll(gzip)
	if err != nil {
		panic(err)
	}
	return string(result)
}

const babelPolyfillJavaScriptSource = ""

var babelPolyfillJavaScript = parseEmbeddedData(babelPolyfillJavaScriptSource)

const composerJavaScriptSource = ""

var composerJavaScript = parseEmbeddedData(composerJavaScriptSource)
